INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`, `amount`, `category_id`, `created_at`, `updated_at`) VALUES
(1, '10K White Gold Natural Mystic Topaz Ring Round 6mm Infinity Diamond Accents, sizes 5 - 10', 'Infinity-designed shank filled with Diamonds, this Ring crafted from Solid Gold and set with natural Gemstones is truly one to to have and to hold. Simply a symbol of love. Excellent quality and workmanship. Available in sizes 5 to 10 with half sizes. Designed by PIERA exclusively for Gabriella Gold.', '586.59', 'https://images-na.ssl-images-amazon.com/images/I/51OaFwzobAL.jpg', 65, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, 'AGS Certified 1 1/4 Carat TW 5 Stone White Diamond Ring in 14K White Gold', 'A beautiful 5 stone ring crafted in 14K white gold featuring 5 sparkling prong set diamonds weighing a total of 1 1/4 carats! A beautiful 5 stone graduated design. The stones are hand selected and matched by experienced jewelers. A great value for a big, diamond look. The setting is crafted in 14K white gold and comes with an AGS (American Gem Society) Laboratory evaluation report certifying diamond quality.', '1000.00', 'https://images-na.ssl-images-amazon.com/images/I/41ianALWQaL.jpg', 95, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, '10K White Gold Round 3-Stone Natural Black Onyx Ring & Garnet Sides Diamond Accent, sizes 5 - 10', 'This Impressive Triple Stone Ring is made of Solid Gold set with Natural Gemstones and Genuine Brilliant Cut Diamond highlights. A lot of colored stones to choose from!', '297.62', 'https://images-na.ssl-images-amazon.com/images/I/41OmUhTookL.jpg', 54, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, '10k White Gold and Diamond Twist Ring (1/2 cttw, I-J Color, I3 Clarity)', 'Round and baguette diamonds display their eye-catching sparkle in this beautiful twist knot ring. Crafted in polished 10 karat white gold and embellished with 1/2 carat of channel- and prong-set diamonds, it\'s a graceful design that\'s sure to attract compliments. This ring makes a lovely gift for an anniversary or other special occasion.\n\n\nThe Amazon Curated CollectionDiscover the Amazon Curated Collection of fine and fashion jewelry. The expansive selection of high-quality jewelry featured in the Amazon Curated Collection offers everyday values that range from precious gemstone and diamond pieces to the latest fashion designs.This hand-selected assortment features an array of diamond, gemstone, and precious metal designs that receive a quality inspection, including from Amazon’s staff graduate gemologist, to ensure they meet Amazon’s high standards. All diamonds featured in the Amazon Curated Collection are certified by our suppliers to be conflict free, and IGI, GIA, or AGS certifications are provided on white diamonds of .75 carats or larger on all stud earrings, rings, and pendant necklaces.Pieces from the Amazon Curated Collection come packaged in a custom box, making them wonderful gifts. In addition, we offer free one-day shipping within the continental U.S. on items over $500. International shipping options for friends and family overseas are available for an additional fee.The Amazon Curated Collection offers a specialized customer service team that is available seven days a week to answer any product questions before, during or after the purchase. If you’re not satisfied for any reason, you will receive a full refund and free return shipping within the U.S. if you return your purchase within 30 days.Find a special gift for a loved one or a beautiful piece that complements your personal style with jewelry from the Amazon Curated Collection. Diamond Clarity:No two diamonds are alike. A diamond\'s most distinguishing characteristics are its inclusions, marks that are often invisible to the naked eye. However, under a jeweler\'s magnifying loupe or microscope they can look like crystals, tiny rivers, or clouds. A diamond\'s clarity is determined by the presence or absence of inclusions--fewer inclusions mean better clarity--and how visible they are. The greater a diamond\'s clarity, the greater its brilliance and value. A diamond categorized as internally flawless will have no inclusions, but this is extremely rare.Diamond Color:Though diamonds come in a wide range of colors, colorless diamonds have traditionally been considered the most valuable. Most diamonds are graded on a scale using the letters of the alphabet, from D (colorless), the best grade, through Z (a light yellow). It is difficult for the untrained eye to notice such variations in color unless stones are being compared side by side.Diamond Carat Weight:A diamond\'s weight is measured in carats, with one carat being equivalent to 100 points. You will often see a diamond referred to as a 3/4-carat stone or a 75-point diamond. Larger stones are often more highly valued, but size should not be the only consideration--high brilliance, which varies according to clarity, cut, and color grade, is highly desirable in a diamond.Diamond Certification:A diamond certificate represents independent verification that the stone purchased has all the qualities of cut, color, clarity, shape, and weight expected. It is a further indication of the condition and value of that diamond as represented on our site. Such certificates are issued by several agencies employing highly trained gemologists and provide an unbiased and accurate evaluation of the diamond. These gemologists scrutinize each stone to analyze its dimensions, clarity, cut, color, finish, symmetry, and other details.Diamonds purchased from the Amazon.com Collection may be certified by the Gemological Institute of America or the International Gemological Institute. The type of certificate provided will be noted in the product specifications of your jewelry purchase; if you do not see a certificate type noted, one will not be provided.Our Diamond Policy:Amazon.com sources high-quality diamonds from some of the world\'s largest suppliers. All our diamond suppliers certify that to their best knowledge their diamonds are not conflict diamonds.Diamond Care:Diamonds, as the hardest substance on earth, are resistant to damage. However, diamond jewelry is set in different metals, and care will vary from piece to piece. Diamonds should be cleaned in a solution of one part ammonia to six parts water, using a gentle scrubbing brush to remove any dirt. It is a good idea to have them cleaned once a year by a professional jeweler, at which time the security of the setting can be checked as well. Diamond jewelry should be stored in a soft cloth pouch to ensure that the stone will not scratch other jewelry.', '350.00', 'https://images-na.ssl-images-amazon.com/images/I/51Oi-zho-tL.jpg', 65, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, '8.5 Ct Certified Moissanite Band Ring, Unique Bridal Wedding Promise Ring, DE-VS1 Color Clarity Gemstone Cluster Ring, Statement Women Eternity Ring, 14K Gold', '', '1340.00', 'https://images-na.ssl-images-amazon.com/images/I/51sJq%2BTdusL.jpg', 55, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, '10k Yellow Gold Diamond Heart Ring (1/10cttw, I-J Color, I2-I3 Clarity)', 'The Amazon Curated CollectionDiscover the Amazon Curated Collection of fine and fashion jewelry. The expansive selection of high-quality jewelry featured in the Amazon Curated Collection offers everyday values that range from precious gemstone and diamond pieces to the latest fashion designs.This hand-selected assortment features an array of diamond, gemstone, and precious metal designs that receive a quality inspection, including from Amazon’s staff graduate gemologist, to ensure they meet Amazon’s high standards. All diamonds featured in the Amazon Curated Collection are certified by our suppliers to be conflict free, and IGI, GIA, or AGS certifications are provided on white diamonds of .75 carats or larger on all stud earrings, rings, and pendant necklaces.Pieces from the Amazon Curated Collection come packaged in a custom box, making them wonderful gifts. In addition, we offer free one-day shipping within the continental U.S. on items over $500. International shipping options for friends and family overseas are available for an additional fee.The Amazon Curated Collection offers a specialized customer service team that is available seven days a week to answer any product questions before, during or after the purchase. If you’re not satisfied for any reason, you will receive a full refund and free return shipping within the U.S. if you return your purchase within 30 days.Find a special gift for a loved one or a beautiful piece that complements your personal style with jewelry from the Amazon Curated Collection.', '197.30', 'https://images-na.ssl-images-amazon.com/images/I/51bqZKzay9L.jpg', 84, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, 'AGS Certified 1 Carat Diamond Solitaire Ring in 14K Yellow Gold (J-K Color, I2-I3 Clarity)', 'A sparkling round diamond weighing 1 carat is set on a classic solitaire setting crafted in 14K yellow gold. A great value on a diamond ring that will surely be treasured forever. Diamonds are hand selected and set with a minimum J-K color and I2-I3 clarity rating. The ring comes with an Evaluation Report from the American Gem Society Laboratory certifying diamond quality. An excellent value on a 1 carat diamond solitaire ring set on a 14K yellow gold ring setting.', '1200.00', 'https://images-na.ssl-images-amazon.com/images/I/41xRi9e6kSL.jpg', 30, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, 'AGS Certified 1 Carat TW Diamond Three Stone Ring in 10K White Gold (K-L Color, I2-I3 Clarity)', 'A classic three stone ring featuring channel set side diamonds set in 10K white gold. 9 diamonds weigh 1 carat in total weight. A beautiful three stone diamond ring symbolizing your past, present and future. The ring is accompanied by an independently graded AGS (American Gem Society) Laboratory evaluation report certifying diamond quality.', '699.00', 'https://images-na.ssl-images-amazon.com/images/I/41hX83GWnhL.jpg', 74, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
