(13, 'Vintage 1/4 CT Marquise Round Certified Diamond Cluster Eternity Ring, 14k Gold Wedding Anniversary Bridal Ring Sets, Statement Promise Matching Rings, 14K Gold', 'Round Marquise Diamonds delicately enhances the sparkles of the Bridal Wedding Ring and Round Cut Diamonds Cluster beautifully provides the base to the Ring. Gold Wedding Women Ring makes distinctive and Unique Engagement Ring. We feature this Wide Anniversary Band in 14kt Gold.', '560.00', 'https://images-na.ssl-images-amazon.com/images/I/41Q8a9fC8WL.jpg', 58, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
