(19, 'Platinum or Gold Plated Sterling Silver Swarovski Zirconia Antique Ring Set', 'An Amazon brand - Sparkling antique-style ring with asscher-cut Swarovski zirconia and band with prong-set faceted rounds', '39.00', 'https://images-na.ssl-images-amazon.com/images/I/51to1zKccpL.jpg', 39, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
