(21, 'Sterling Silver Diamond Heart Ring (1/20 cttw, I-J Color, I3 Clarity)', 'Give her a gift she\'ll cherish always with the stunning Sterling Silver Diamond Heart Ring. The ring measures .39 inch high and is made from high-quality 925 sterling silver for a long-lasting shiny finish. Lined with round white diamonds of IJ color and I2-I3 clarity, the ring has a double ribbon shape that is unique and modern. The smooth silver ribbon curves around itself to form a heart shape at the center of the ring. A thin band finishes the back of the ring, providing an easy fit for everyday wear. With a total of .05 carats, this heart and diamond ring is sure to capture her heart with its beauty and sentiment.\n\n\nThe Amazon Curated CollectionDiscover the Amazon Curated Collection of fine and fashion jewelry. The expansive selection of high-quality jewelry featured in the Amazon Curated Collection offers everyday values that range from precious gemstone and diamond pieces to the latest fashion designs.This hand-selected assortment features an array of diamond, gemstone, and precious metal designs that receive a quality inspection, including from Amazon’s staff graduate gemologist, to ensure they meet Amazon’s high standards. All diamonds featured in the Amazon Curated Collection are certified by our suppliers to be conflict free, and IGI, GIA, or AGS certifications are provided on white diamonds of .75 carats or larger on all stud earrings, rings, and pendant necklaces.Pieces from the Amazon Curated Collection come packaged in a custom box, making them wonderful gifts. In addition, we offer free one-day shipping within the continental U.S. on items over $500. International shipping options for friends and family overseas are available for an additional fee.The Amazon Curated Collection offers a specialized customer service team that is available seven days a week to answer any product questions before, during or after the purchase. If you’re not satisfied for any reason, you will receive a full refund and free return shipping within the U.S. if you return your purchase within 30 days.Find a special gift for a loved one or a beautiful piece that complements your personal style with jewelry from the Amazon Curated Collection.', '32.90', 'https://images-na.ssl-images-amazon.com/images/I/41qrKhAznUL.jpg', 50, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(22, 'Classic Twist with White Diamond Sterling Silver Ring (1/10cttw, I-J Color, I2-I3 Clarity)', '', '105.20', 'https://images-na.ssl-images-amazon.com/images/I/61VZZX84wOL.jpg', 35, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
