(24, 'Platinum-Plated Sterling Silver Swarovski Zirconia Cushion Halo Ring Set', 'An Amazon brand - Cushion halo ring set adorned with round brilliant cut Swarovski Zirconia, each ring features two Swarovski Zirconia set bands', '49.00', 'https://images-na.ssl-images-amazon.com/images/I/51SmVeBMm4L.jpg', 72, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25, 'Amazon Collection Platinum-Plated Sterling Silver Celebrity \"Kate\" Ring made with Swarovski Zirconia Accents', 'An Amazon brand - Oval brilliant cut sparkler ring surrounded by a halo of Swarovski Zirconia accents', '49.00', 'https://images-na.ssl-images-amazon.com/images/I/5163vm1ND5L.jpg', 68, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26, 'Stress Relieving Meditation Oxidized Spinner Ring 925 Sterling Silver Boho Handmade Fashion Jewelry for Women', 'Adorn yourself with distinctive and lavish looks of this striking ring. Artistically crafted in sterling silver, this spectacular ring will keep your finger gleaming. Make it a part of your jewelry collection and treasure the spark forever. All ShopLC 925 Sterling Silver Jewelry is genuine silver and stamped with 925S on the inside. Product Details: Metal: Sterling Silver Color: White If you like it, we advise you add it to wish list now, we can inform you immediately once it has a discount.', '14.59', 'https://images-na.ssl-images-amazon.com/images/I/41DBckcXsPL.jpg', 39, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27, 'Platinum or Gold Plated Sterling Silver All-Around Band Ring set with Round Swarovski Zirconia', 'An Amazon brand - All-around ring featuring eternity band set with round brilliant cut Swarovski Zirconia, the most brilliant simulated diamonds in the world', '24.00', 'https://images-na.ssl-images-amazon.com/images/I/51RG8omwggL.jpg', 40, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28, 'Platinum or Gold Plated Sterling Silver Asscher-Cut Halo Ring Set with Swarovski Zirconia', 'An Amazon brand - Asscher cut centerpiece set with Swarovski Zirconia (1.5 cttw) surrounded by a halo of smaller stones', '39.00', 'https://images-na.ssl-images-amazon.com/images/I/51rOLxTSlqL.jpg', 64, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29, 'Kobelli Three-Stone Diamond Engagement Ring and Wedding Band Set 4/5 carat (ctw) in 14k White Gold', 'This three-stone diamond bridal set deserves to be your symbol of love and the loudest expression of how refined your taste is. You can have it as easy as 1-2-3 with a small empire of 31 princess and round diamonds that give this set an overall diamond value of 4/5 carats. The entire creation is made out of 14K sterling white gold.', '1500.00', 'https://images-na.ssl-images-amazon.com/images/I/51jArVrwP9L.jpg', 90, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(30, 'Dazzlingrock Collection 1.85 Carat (ctw) 10K Gold Blue & White Sapphire Ladies 3 Stone Bridal Engagement Ring Matching Band Set', 'This lovely bridal Ring set features 1.85 ct white and blue sapphires in 3-stone setting. All sapphires are sparkling and 100% natural. All our products with FREE gift box and 100% Satisfaction guarantee. Blue Sapphire is very dark blue in color - Color varies from photo. SKU # K2392', '714.95', 'https://images-na.ssl-images-amazon.com/images/I/51fTpaReSfL.jpg', 90, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31, 'Kobelli Princess Diamond Wedding Ring Set 1 Carat (ctw) in 14K White or Yellow Gold', 'Kobelli 1 Carat (ct.tw) Bridal Rings Set - Classically Charming and Graceful Design  Take her breath away with the stunning 1 Carat (ct.tw) Bridal Rings Set by Kobelli. The charming engagement ring showcases a raised princess-cut diamond with three round brilliant-cut channel-set diamonds to each side, and pave-set accent diamonds. Perfectly matched with a romantically simple, diamond encrusted pave-set wedding band, this pair of rings is ready for your big day.  Princess diamond wedding rings set by Kobelli Kobelli guarantees ethical practices and conflict-free materials Diamonds are set in 14-karat gold with prong, pave, and channel settingsKey Features 100% Authentic Fine Jewelry1/3 Carat Princess CenterRound Brilliant Accent Diamonds2-Piece SetRing Gift Box Included Shipment Ring Comes Packed into a Giftable Box Under Warranty by Kobelli Unless Tampered With Exclusively Sold by Kobelli -- *We ship within 1-2 business days from CA, USA with expedited delivery on all domestic orders. Your item will arrive in discrete outer packaging with adult signature required. *Exceptions Apply if Fulfilled by Amazon (See Estimated Delivery in Your Orders if FBA).Any Questions Left Below Will be Answered Promptly by Kobelli Customer Service!', '1100.00', 'https://images-na.ssl-images-amazon.com/images/I/617rNwm37hL.jpg', 34, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32, 'Kobelli 3-2/5ct.tw Radiant Moissanite Drop Halo Bridal Set', 'A drop halo carries a 9x7mm (2-3/4ct) radiant cut moissanite gemstone over this 2 piece bridal set in 14-karat gold. A notched curve fits the wedding band perfectly in place against the center setting. Every round stone on this piece is a genuine natural white diamond while the centerstone is a remarkably crafted moissanite. The rings in the photos are a size 5.', '950.00', 'https://images-na.ssl-images-amazon.com/images/I/41ekVc%2BF6rL.jpg', 38, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(33, 'Kobelli Moissanite Bridal Set Subtle Floral Motif 1 7/8 CTW 14k Yellow Gold (FG/VS, GH/I)', 'Four claw prongs hold a one-and-a-half carat moissanite atop this floral inspired engagement ring. Diamonds wrap the top underneath the center stone for a stunning profile view where the floral theme is seen. Pairing to this delightful ring is an eternity diamond wedding band. Moissanite: very-good-cut FG VS Round Synthetic Heat-treated 1.5ctw;Diamond: good-cut GH I1-I2 Round Natural Not-treated 0.43ctw', '1900.00', 'https://images-na.ssl-images-amazon.com/images/I/51RiNZESAbL.jpg', 91, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(34, 'Kobelli Cushion Moissanite Solitaire Band Bridal Set 1 1/4 CTW in 14k White Gold', 'This cushion cut moissanite solitaire engagement ring is fashioned with a diamond wedding band in 14-karat white gold on this two piece set. The engagement ring is styled in a wide 5 mm band tapering down along the shank.', '899.00', 'https://images-na.ssl-images-amazon.com/images/I/41B9S-qcZUL.jpg', 76, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35, 'Kobelli Moissanite and Lab Grown Diamond Bridal Rings Set 2 1/3 CTW 14k White Gold (HI/VS, DEF/VS)', 'A round brilliant-cut Kobelli Moissanite and lab grown diamonds line this classic bridal rings set in solid 14-karat gold. The center stone is an 8 mm (1.9 carat) moissanite gemstone, similarly created in a lab like the lab-grown diamonds set beside it. The prong set stones are all round brilliant-cut to best showcase the beautiful sparkles. With the diamonds graded at an illuminating DEF color and VS clarity, this pairing leaves no detail of eye-catching refinement behind. The moissanite and diamonds alike are eco-friendly and responsibly grown. The diamonds rank at the top of the diamond hierarchy with its unclouded cores and perfectly cut facets while the moissanite showcases its famed firey brilliance. The ring matches to Kobelli wedding band LG61962D. Comes with a Kobelli Certificate of Authenticity and Limited Lifetime Warranty Card', '1400.00', 'https://images-na.ssl-images-amazon.com/images/I/51pEbhz%2BVDL.jpg', 77, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(36, 'Kobelli Princess Diamond Wedding Ring Set 1 1/6 carat (ctw) in 14k White Gold', '1 1/6 Carats (ct.tw) 3-Square Frame Halo Diamonds 2-Piece Set - Bold Bridal Fashion Strong and elegant, this wide 14-karat white gold bridal set will add breathtaking appeal to your style. The engagement ring features a center cluster of 4 princess-cut diamonds, set together in a square with a pave-set halo. Accompanying this center feature to each side is a smaller series of pave halo princess-cut diamonds. The wide band features three rows of round-cut diamonds that add texture and flair to the ring. Round-cut white diamonds are pave-set into the matching wedding band, fitting to the engagement ring in a glittering display.  Triple square frame halo statement bridal set by Kobelli  Diamonds are set in 14-karat white gold  The width of the set from the top of the set is 10.4mm and tapers delicately to the bottom at 5.75mm  Expert craftsmanship from Los Angeles, California  Kobelli guarantees ethical practices and conflict-free materials', '1200.00', 'https://images-na.ssl-images-amazon.com/images/I/61AtBf51clL.jpg', 95, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(37, 'Kobelli Blue Sapphire & Diamond Wedding Rings Set 1 1/3 Ct (ctw) In 14k White Gold', 'This eye-catching bridal set features princess and baguette cut white diamonds alongside beautiful blue sapphires. Set includes three rings. One engagement ring and two matching bands. *Sapphire color may vary due to variations in gemstone parcels (3 Piece Set)', '1100.00', 'https://images-na.ssl-images-amazon.com/images/I/61nPehiaf9L.jpg', 44, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(38, 'Kobelli Forever One Moissanite and Lab Grown Diamond Bridal Rings Set 2 1/3 CTW 14k White Gold (DEF/VS)', 'A round brilliant-cut Forever One Moissanite and lab grown diamonds line this classic bridal rings set in solid 14-karat gold. The center stone is an 8 mm (1.9 carat) moissanite gemstone, similarly created in a lab like the lab-grown diamonds set beside it. The prong set stones are all round brilliant-cut to best showcase the beautiful sparkles. With the diamonds graded at an illuminating DEF color and VS clarity, this pairing leaves no detail of eye-catching refinement behind. The moissanite and diamonds alike are eco-friendly and responsibly grown. The diamonds rank at the top of the diamond hierarchy with its unclouded cores and perfectly cut facets while the moissanite showcases its famed firey brilliance. The ring matches to Kobelli wedding band LG61962D. Comes with a Kobelli Certificate of Authenticity and Limited Lifetime Warranty Card', '1350.00', 'https://images-na.ssl-images-amazon.com/images/I/516Fg3TLsYL.jpg', 50, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(39, 'Kobelli Round Moissanite Bridal Set 14k White Gold', 'This eye-catching bridal set features one large round-cut moissanite, baguette-cut white diamonds, and two beautiful sapphires.', '800.00', 'https://images-na.ssl-images-amazon.com/images/I/51hCsqwlaYL.jpg', 95, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(40, 'Kobelli Moissanite and Lab Grown Diamond Halo Bridal Rings Set 1 1/2 CTW in 14k White Gold (HI/VS, DEF/VS)', 'A Kobelli Moissanite and lab grown diamonds line this halo bridal set in solid 14k gold metal. The center stone is a 6 mm cushion shaped brilliant-cut moissanite gemstone, similarly created in a lab like the lab-grown diamonds set beside it. The prong set stones are all brilliant-cut to best showcase the beautiful sparkles. With the diamonds graded at an illuminating DEF color and VS clarity, this pairing leaves no detail of eye-catching refinement behind. The moissanite and diamonds alike are eco-friendly and responsibly grown. The diamonds rank at the top of the diamond hierarchy with its unclouded cores and perfectly cut facets while the moissanite showcases its famed firey brilliance. The ring matches to Kobelli wedding bands LG61765D and LG61765D2. Comes with a Kobelli Certificate of Authenticity and Limited Lifetime Warranty Card', '1600.00', 'https://images-na.ssl-images-amazon.com/images/I/51s9-J%2BQk9L.jpg', 61, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(41, 'Kobelli Round H-I Moissanite Cushion Halo Bridal Wedding Set 4 CTW 14k White Gold', 'A 3 carat brilliant-cut moissanite is centered on this halo diamond bridal wedding rings set. The moissanite is a synthetic lab-created gemstone while the diamonds are naturally earth mined from conflict-free sources. The engagement ring features a semi-split shank band made with 14-karat gold and a highly polished finish. The ever-popular halo style is depicted here with a mix of the two stone types and an extra large display of glittering beauty to create a bold statement.1 Near Colorless Kobelli Moissanite (H-I).75 Natural White Diamonds.', '2000.00', 'https://images-na.ssl-images-amazon.com/images/I/51m38FdsJbL.jpg', 72, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(42, 'Dazzlingrock Collection 0.50 Carat (ctw) 10K Gold Round Diamond Split Shank Heart Shaped Bridal Engagement Ring Band Set 1/2 CT', 'This lovely diamond Ring set features 0.50 ct white diamonds in prong setting. All diamonds are sparkling and 100% natural. All our products with FREE gift box and 100% Satisfaction guarantee. SKU # K2259', '472.40', 'https://images-na.ssl-images-amazon.com/images/I/51HF5Kbo-lL.jpg', 84, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
