(45, 'Kobelli 2ct Round Moissanite Fancy Hidden Halo Set', 'Kobelli 2-7/8 Carat TW Round Moissanite and Lab Grown Diamond Bridal Set in 14k Gold A fancy diamond lined prong basket carries this 2 carat moissanite gemstone in a cathedral ring setting. All diamonds lining these two rings are lab-grown to pristine condition for a phenomenal glittering brilliance. 8mm Round Moissanite (2 Carat DEW) 98 Round Lab Grown Diamonds (7/8 Carats TDW), DEF/VS 14k White, Yellow, or Rose Gold Near-eternity design with room for any future resizing Design Features: Cathedral Top, Hidden Halo, Fancy Prong Head, 2-Piece Set  Genuine PhotosAll photos on this product are taken in-house with real stock set. The set in the photos, including the one on our happy coworker, is a size 6.', '1250.00', 'https://images-na.ssl-images-amazon.com/images/I/51sqJo11YxL.jpg', 42, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(46, 'Kobelli Diamond 3 Ring Wedding Set 1 1/2 carat (ctw) in 14k White Gold', 'Kobelli Princess Halo Dynamic Square Rings - 3-Rings Bridal Set  The Kobelli Princess Square Halo Rings is a bridal set you have to see for yourself to fully appreciate. Admittedly, our photos do not do this set justice even with all our efforts to capture its full glory, because the true brilliance lies in how the set animates wondrous shines as the stack wraps around your wedding finger. Non-stop compliments will be directed your way as this is not a subtle bridal set. The captivating visual serves as an endearing reminder of the love it symbolizes.  Diamonds are set in solid 14-karat white gold metal with shiny white rhodium finish for absolute brightness.   Available in womens US sizes 4 to 11   Decorated with 189 natural-grown diamonds   Kobelli guarantees ethical practices and conflict-free materials', '2300.00', 'https://images-na.ssl-images-amazon.com/images/I/51ZXW4KjZQL.jpg', 91, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
