(48, 'Dazzlingrock Collection 0.50 Carat (ctw) 10k Black and White Diamond Swirl Bridal Engagement Ring Matching Band Set, White Gold', 'This lovely diamond ring feature 0.50 ct white & black diamonds in Prong and Channel setting. All diamonds are sparkling and 100% natural. All our products with FREE gift box and 100% Satisfaction guarantee. The Black Diamonds may have one or two small chips and or white spots. The black diamonds in this item are semi-faceted and natural. These black diamonds qualify as rose-cut or diamond accents. The black diamonds in this jewelry item are of not of gem quality, and contain varying number of facets from 0 to 16. Natural black diamonds are rare. Dazzlingrock sells only heat treated black diamonds, treated with the High Pressure Heat Treatment (HPHT) method. In HPHT treatment, diamonds are heated to approximately 1260 degrees, and the diamonds become black. HPHT treatment is completely safe and permanent. SKU # DR0052-1365', '442.37', 'https://images-na.ssl-images-amazon.com/images/I/41Mni%2BpPmlL.jpg', 34, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(49, 'Kobelli Moissanite and Blue Sapphire Halo Bridal Rings Set', 'KOBELLI CUSHION MIXED STONE BRIDAL SET Natural diamond halo, moissanite center stone, blue sapphire accented band. Two piece bridal set. With your purchase of the Kobelli Bridal Set, you will receive a Kobelli warranty card. The card is to remind you that any Kobelli jewelry you own is guaranteed for quality and will be accepted for any future services you may need, as long as the product has not been tampered with by outside jewelers, or by drastic miscare. The Kobelli Bridal Set comes packed carefully into a ring box for you to store away into your personal collection, or to give as a gift. Our jewelry is designed to last you a lifetime which is why we use only the finest materials known to Earth.   Made with Solid 14k White Gold (not filled nor plated) 6mm Cushion Shape Moissanite (1.10 Carat) 1/4 Carat TDW Natural White Diamond Side Stones 1/3 Carat TGW Natural Blue Sapphire Side Stones GH Diamond Color, I1-I2 Diamond Clarity Designed and Made by Kobelli Fine Jewelers in Los Angeles, CA Sold at Manufacturer Direct Discounted Deals Everyday Ships in Discrete Outer Packaging with Adult Signature Required (Please ship to an address where someone will be able to receive the package for you) FREE Shipping (within the US) FREE Returns (30 Days) Consider an additional wedding band. Search, 62564DBS', '1500.00', 'https://images-na.ssl-images-amazon.com/images/I/51IbXxJeCvL.jpg', 79, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(50, 'Dazzlingrock Collection 1.10 Carat (ctw) 14K Gold Round Black & White Diamond Ladies Bridal Halo Engagement Ring Band Set 1 CT', 'This lovely engagement ring set feature 1.10 ct white & black diamond in halo setting. All diamonds are sparkling and 100% natural. All our products with FREE gift box and 100% Satisfaction guarantee. The Black Diamonds may have one or two small chips and or white spots. The black diamonds in this item are semi-faceted and natural. These black diamonds qualify as rose-cut or diamond accents. The black diamonds in this jewelry item are of not of gem quality, and contain varying number of facets from 0 to 16. Natural black diamonds are rare. Dazzlingrock sells only heat treated black diamonds, treated with the High Pressure Heat Treatment (HPHT) method. In HPHT treatment, diamonds are heated to approximately 1260 degrees, and the diamonds become black. HPHT treatment is completely safe and permanent. SKU # K2582', '507.05', 'https://images-na.ssl-images-amazon.com/images/I/51j-soSzD1L.jpg', 83, 3, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
