(109, '10K Gold Round Checkerboard Created or Genuine Gemstone Stud Earrings', 'The Amazon Curated CollectionDiscover the Amazon Curated Collection of fine and fashion jewelry. The expansive selection of high-quality jewelry featured in the Amazon Curated Collection offers everyday values that range from precious gemstone and diamond pieces to the latest fashion designs.This hand-selected assortment features an array of diamond, gemstone, and precious metal designs that receive a quality inspection, including from Amazon’s staff graduate gemologist, to ensure they meet Amazon’s high standards. All diamonds featured in the Amazon Curated Collection are certified by our suppliers to be conflict free, and IGI, GIA, or AGS certifications are provided on white diamonds of .75 carats or larger on all stud earrings, rings, and pendant necklaces.Pieces from the Amazon Curated Collection come packaged in a custom box, making them wonderful gifts. In addition, we offer free one-day shipping within the continental U.S. on items over $500. International shipping options for friends and family overseas are available for an additional fee.The Amazon Curated Collection offers a specialized customer service team that is available seven days a week to answer any product questions before, during or after the purchase. If you’re not satisfied for any reason, you will receive a full refund and free return shipping within the U.S. if you return your purchase within 30 days.Find a special gift for a loved one or a beautiful piece that complements your personal style with jewelry from the Amazon Curated Collection. August Birthstone: PeridotThe lively light green hue of August\'s birthstone conveys positive energy and optimism, and those born in August are said to be happy, generous people. Peridot is also believed to promote tranquility, enhance speech, and foster good relationships in marriage.History of BirthstonesChances are you can name your birthstone, but have you ever wondered how certain stones came to be associated with particular months? Most gem scholars trace the tradition to the Old Testament story of Aaron, whose breastplate was decorated with twelve precious stones, one for each of the twelve tribes of Israel. Over time, these stones were linked with certain powers and tied to particular astrological signs, and later to calendar months.There are many variations of birthstone lists, including Mystical birthstones, which originate from Tibet and date back over a thousand years, and Ayurvedic birthstones, associated with ancient Indian medicine and beliefs. Birthstones have also been tied to ancient Pagan religions, and even to the collective wisdom of the legendary lost city of Atlantis.The modern birthstone list, perhaps the most universally known, was released by the American National Association of Jewelers and officially adopted in 1912. Whether you embrace birthstone lore, or look upon it with a skeptical eye, there is an undeniable appeal to collecting a beautiful gemstone that is reputed to hold special power, meaning, and good fortune just for you.', '68.08', 'https://images-na.ssl-images-amazon.com/images/I/41rRwhr8LOL.jpg', 73, 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
