(125, 'Platinum Plated Sterling Silver Cushion Cut Cubic Zirconia Stud Earrings', 'Add a little sparkle to any outfit with these beautiful cushion-cut cubic zirconia stud earrings. The 7mm stones have a square shape with rounded corners and are cradled in four-prong settings of platinum-plated sterling silver. With their fancy shape and pretty sparkle, these versatile studs are unique and eye-catching. Platinum plating on the sterling silver gives these post-set earrings a rich finish, and also makes them tarnish-proof and hypoallergenic.', '14.00', 'https://images-na.ssl-images-amazon.com/images/I/41D9QGoY5QL.jpg', 40, 5, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
