(185, '.925 Sterling Silver Alternating AAA Cubic Zirconia Tennis Bracelet, 7.5\"', 'The Amazon Curated CollectionDiscover the Amazon Curated Collection of fine and fashion jewelry. The expansive selection of high-quality jewelry featured in the Amazon Curated Collection offers everyday values that range from precious gemstone and diamond pieces to the latest fashion designs.This hand-selected assortment features an array of diamond, gemstone and precious metal designs that receive a quality inspection, including from Amazon’s staff graduate gemologist, to ensure they meet Amazon’s high standards. All diamonds featured in the Amazon Curated Collection are certified by our suppliers to be conflict free, and IGI, GIA, or AGS certifications are provided on white diamonds of .75 carats or larger on all stud earrings, rings, and pendant necklaces.Pieces from the Amazon Curated Collection come packaged in a custom box, making them wonderful gifts. In addition, we offer free one-day shipping within the continental US on items over $500. International shipping options for friends and family overseas are available for an additional fee.The Amazon Curated Collection offers a specialized customer service team that is available seven days a week to answer any product questions before, during or after the purchase. If you’re not satisfied for any reason, you will receive a full refund and free return shipping within the US if you return your purchase within 30 days.Find a special gift for a loved one or a beautiful piece that complements your personal style with jewelry from the Amazon Curated Collection. Cubic ZirconiaHistoryIn 1937, Cubic Zirconia was first discovered by German mineralogists, M. V. Stackelberg and K. Chudoba. Little did they know, the tiny crystals that they discovered would move on to become a popular synthetic gemstone. It wasn’t until the 1970s that Cubic Zirconia was first used in the jewelry world, when scientists began growing the crystals in the laboratory. In the 1980s, Cubic Zirconia use in jewelry continued to grow and today is it one of the most popular diamond substitutes available on the market.CompositionCubic Zirconia is the cubic form of zirconium oxide that is created in a laboratory. Its durable material allows the synthetic stone to be molded into a variety of shapes. The stone offers brilliant shine and flawless clarity. Cubic Zirconia is available in a wide range of colors, including a colorless form that is an economically important competitor to natural diamonds.Caring For Your Cubic Zirconia JewelryLike natural diamonds, Cubic Zirconia needs to be cared for in order to maintain its original brilliance and shine. Clean with warm-to-hot water and a soft brush with a mild soap, then immediately dry with a clean cloth after rinsing. Avoid contact with perfume, body lotion, hairspray or any other chemical that may harm the shine of the stone.', '30.00', 'https://images-na.ssl-images-amazon.com/images/I/41Y2SQOxaJL.jpg', 85, 7, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
