(249, '10K Yellow Gold Oval AAA Grandidierite White Diamond Pendant Women Jewelry Gift Ct 1.2 G-H Color I3 Clarity', 'Undeniably beautiful, this premium grandidierite halo pendant adds a stylish bling to your style. Design inspired from the shape of Ballerina’,s tutu, the jewelry is inlayed with diamonds. This elegant pendant is an ideal way to take your style game a notch higher and look all the way more beautiful. Set in 10K yellow gold Faceted oval shape grandidierite in center Baguettes of diamonds on halo and bale Genuine diamonds Prongs setting Superior finish and smooth under gallery This trichroic gem is associated with faith, trust, patience and respect Product Details: Metal: Yellow Gold Color: Yellow Stone 2 Details: Stone Name: Diamond Carat Wt.: 0.05 Ct.Shape: Baguette Shape Color: G H Creation Method: Natural Treatment Method: Not Treated If you like it, we advise you add it to wish list now, we can inform you immediately once it has a discount.', '212.83', 'https://images-na.ssl-images-amazon.com/images/I/41pNBtp0qGL.jpg', 80, 9, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
