(290, '14K Rose Gold over Sterling Silver Created Opal with Created Pink Sapphire Cross Pendant Necklace, 18\"', 'The Amazon Curated CollectionDiscover the Amazon Curated Collection of fine and fashion jewelry. The expansive selection of high-quality jewelry featured in the Amazon Curated Collection offers everyday values that range from precious gemstone and diamond pieces to the latest fashion designs.This hand-selected assortment features an array of diamond, gemstone, and precious metal designs that receive a quality inspection, including from Amazon’s staff graduate gemologist, to ensure they meet Amazon’s high standards. All diamonds featured in the Amazon Curated Collection are certified by our suppliers to be conflict free, and IGI, GIA, or AGS certifications are provided on white diamonds of .75 carats or larger on all stud earrings, rings, and pendant necklaces.Pieces from the Amazon Curated Collection come packaged in a custom box, making them wonderful gifts. In addition, we offer free one-day shipping within the continental U.S. on items over $500. International shipping options for friends and family overseas are available for an additional fee.The Amazon Curated Collection offers a specialized customer service team that is available seven days a week to answer any product questions before, during or after the purchase. If you’re not satisfied for any reason, you will receive a full refund and free return shipping within the U.S. if you return your purchase within 30 days.Find a special gift for a loved one or a beautiful piece that complements your personal style with jewelry from the Amazon Curated Collection. GemstonesColorJewelers describe the color of a gemstone in terms of three characteristics: hue, saturation, and tone. A gemstone\'s basic color is its hue, and those with purer hues (for emeralds, green; for sapphires, blue; and for rubies, red) are generally considered more valuable. Often, however, a hint of another color can be detected. Saturation is a measure of the intensity or purity of a gem\'s hue and is determined by the degree to which gray or brown hues mute its defining color. Value tends to increase with saturation, so a fully saturated purplish blue sapphire may well be more expensive than a muted pure blue one. The tone of a gemstone, a measurement of its lightness or darkness, is usually given as light, medium-light, medium, medium-dark, or dark.ClarityA flawless gemstone is rare and expensive. As with diamonds, most gemstones have inclusions, or tiny mineral flaws, that can be seen under magnification or by the careful eye. Make sure that any inclusions in the stone do not penetrate deeply into the gem, as this may cause it to break or crack. Clarity grades range from VVS (very, very slightly included) to I3, in which inclusions are prominent and severely affect the gemstone\'s beauty.CutA gemstone\'s cut refers to its proportions and symmetry. In making a gemstone look appealing--the stone should be symmetrical in all dimensions so that it will appear balanced, and that its facets will reflect light evenly. Color should also be taken into account when cutting for optical efficiency. If a stone\'s color is highly saturated, a shallow cut will allow it to pass more light, while a deeper cut may increase the vividness of a less saturated gem. There is no generally accepted grading system for gemstone cut.SizeThough a gemstone\'s weight is usually given in carats, this may not give an accurate idea of its size, because different types of stone have different densities. Therefore, a one-carat sapphire or ruby will be smaller than a one-carat emerald, though they have the same weight, because sapphires and rubies (both a form of the mineral corundum) are more dense than emeralds.Gemstones can also be measured in dimensions (diameter, length, and width). It is important to know the dimensions to ensure that the gemstone weight will be visible and well-proportioned in the setting.Gemstone TreatmentGemstones are often treated to enhance color and fill cracks. Please note: if a gemstone has been treated, this information will be provided in the specifications on the stone\'s product detail page.There are various accepted techniques, depending on the type of stone:Oils and resins are frequently used to fill surface-reaching fissures in emeralds and rubies. This process is not permanent; however, if a treated ruby or emerald is subjected to high heat, the filler may leak out of the stone. Sapphires and rubies are often heated in a kiln or furnace to enhance their color. Such heat treatment, which is considered permanent, has been used for centuries.Lightly colored sapphires may also undergo diffusion treatment. This is done by heating a stone in the presence of coloring elements such as titanium or iron, which causes a thin layer of color to be diffused into the stone\'s surface. Because this color layer is so thin, a diffusion-treated sapphire should not be re-polished.Gemstone CareTo clean gemstone jewelry, first wipe it with a soft cloth to remove any dirt. Emeralds require only the use of a soft cloth, as cleaners may damage these soft gems. Sapphires and rubies can be cleaned with either an ultrasonic cleaner or a solution of one part ammonia to six parts water, with a soft brush. Store your gemstone jewelry in a soft cloth pouch or jewelry case so it does not touch other pieces in your collection. As with all jewelry, normal wear and tear can loosen prongs and settings, so it is a good idea to have it checked by a professional jeweler who can make repairs as needed.', '69.90', 'https://images-na.ssl-images-amazon.com/images/I/31%2BkmwqQgLL.jpg', 71, 10, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
