(293, 'Sterling Silver \"I love you to the moon & Back\" Pendant Necklace, 18-Inch', 'A simple way to say I love you, the Sterling Silver I Love You To the Moon And Back Two Piece Pendant Necklace is a wonderful gift for all. Resting from a classic 18-inch necklace is a round-shaped pendant formed out of a separate half-moon and oval shape. While the oval-shaped pendant says I love you the half-moon shape is wrapped with the engraving to the moon and back. This pendant is crafted in 925 sterling silver to present fun and meaningful shine.', '24.00', 'https://images-na.ssl-images-amazon.com/images/I/31CwfzYFaxL.jpg', 99, 10, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
