(299, 'Sterling Silver Engraved Flowers Heart Locket Necklace, 18\"', 'Catch the elegant beauty and timeless design of heart-shaped lockets displayed on the Sterling Silver Engraved Flowers Heart Locket. Resting from an 18-inch rolo chain is a bright 925 sterling silver locket that hangs just over 1-inch in length. The locket is detailed with a playful floral engraving and swirling trim, driving fancy detail. An emblematic gift that can be passed down for generations to come.', '300.00', 'https://images-na.ssl-images-amazon.com/images/I/31tP1AkYLBL.jpg', 97, 10, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(300, 'Sterling Silver Diamond Heart Pendant Necklace (1/10cttw), 18\"', '', '49.00', 'https://images-na.ssl-images-amazon.com/images/I/316UT8%2BqaqL.jpg', 86, 10, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(301, 'Sterling Silver Diamond Heart Pendant Necklace (1/2 cttw), 18\"', 'The Amazon Curated CollectionDiscover the Amazon Curated Collection of fine and fashion jewelry. The expansive selection of high-quality jewelry featured in the Amazon Curated Collection offers everyday values that range from precious gemstone and diamond pieces to the latest fashion designs.This hand-selected assortment features an array of diamond, gemstone, and precious metal designs that receive a quality inspection, including from Amazon’s staff graduate gemologist, to ensure they meet Amazon’s high standards. All diamonds featured in the Amazon Curated Collection are certified by our suppliers to be conflict free, and IGI, GIA, or AGS certifications are provided on white diamonds of .75 carats or larger on all stud earrings, rings, and pendant necklaces.Pieces from the Amazon Curated Collection come packaged in a custom box, making them wonderful gifts. In addition, we offer free one-day shipping within the continental U.S. on items over $500. International shipping options for friends and family overseas are available for an additional fee.The Amazon Curated Collection offers a specialized customer service team that is available seven days a week to answer any product questions before, during or after the purchase. If you’re not satisfied for any reason, you will receive a full refund and free return shipping within the U.S. if you return your purchase within 30 days.Find a special gift for a loved one or a beautiful piece that complements your personal style with jewelry from the Amazon Curated Collection. Diamond Clarity:No two diamonds are alike. A diamond\'s most distinguishing characteristics are its inclusions, marks that are often invisible to the naked eye. However, under a jeweler\'s magnifying loupe or microscope they can look like crystals, tiny rivers, or clouds. A diamond\'s clarity is determined by the presence or absence of inclusions--fewer inclusions mean better clarity--and how visible they are. The greater a diamond\'s clarity, the greater its brilliance and value. A diamond categorized as internally flawless will have no inclusions, but this is extremely rare.Diamond Color:Though diamonds come in a wide range of colors, colorless diamonds have traditionally been considered the most valuable. Most diamonds are graded on a scale using the letters of the alphabet, from D (colorless), the best grade, through Z (a light yellow). It is difficult for the untrained eye to notice such variations in color unless stones are being compared side by side.Diamond Carat Weight:A diamond\'s weight is measured in carats, with one carat being equivalent to 100 points. You will often see a diamond referred to as a 3/4-carat stone or a 75-point diamond. Larger stones are often more highly valued, but size should not be the only consideration--high brilliance, which varies according to clarity, cut, and color grade, is highly desirable in a diamond.Diamond Certification:A diamond certificate represents independent verification that the stone purchased has all the qualities of cut, color, clarity, shape, and weight expected. It is a further indication of the condition and value of that diamond as represented on our site. Such certificates are issued by several agencies employing highly trained gemologists and provide an unbiased and accurate evaluation of the diamond. These gemologists scrutinize each stone to analyze its dimensions, clarity, cut, color, finish, symmetry, and other details.Diamonds purchased from the Amazon.com Collection may be certified by the Gemological Institute of America or the International Gemological Institute. The type of certificate provided will be noted in the product specifications of your jewelry purchase; if you do not see a certificate type noted, one will not be provided.Our Diamond Policy:Amazon.com sources high-quality diamonds from some of the world\'s largest suppliers. All our diamond suppliers certify that to their best knowledge their diamonds are not conflict diamonds.Diamond Care:Diamonds, as the hardest substance on earth, are resistant to damage. However, diamond jewelry is set in different metals, and care will vary from piece to piece. Diamonds should be cleaned in a solution of one part ammonia to six parts water, using a gentle scrubbing brush to remove any dirt. It is a good idea to have them cleaned once a year by a professional jeweler, at which time the security of the setting can be checked as well. Diamond jewelry should be stored in a soft cloth pouch to ensure that the stone will not scratch other jewelry.', '154.80', 'https://images-na.ssl-images-amazon.com/images/I/31g9sQGB%2BgL.jpg', 84, 10, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
